import React, { Component } from 'react';
import './App.css';
import NavBar from './components/navbar';
import HowSusteWorks from './components/howSusteWorks';
import Hero from './components/hero';
import Habits from './components/habits';
import Testimonials from './components/tesimonials';
import GetPlan from './components/getPlan';
import FAQ from './components/faq';

class App extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>

                <NavBar />
                <Hero />     
                <div className="full-sized-images">
                    <img src="./images/5edb96a1f826cfa1669b9cc4_benefits.png"/>
                </div>
                <HowSusteWorks />
                <Habits />
                <Testimonials />
                <GetPlan />
                <FAQ />


                <section class="footer">
                    <h1>Join the champions of change community</h1>
                    <p>Stay up to date with announcements, fun challenges, and exclusive founding member benefits.</p>
                    <hr id="email-break"/>
                    <form> 
                        <div>
                            <input id="signupEmail" type="text" name="text"/>
                            <input type="submit" class="button" value="JOIN"/>
                        </div>
                    </form>
                    <hr/>
                    <footer>
                        <div class="wrapper">
                            <div class="footer-logo">
                                <a href=".">
                                    <img src="./images/suste-logo.png" alt="Suste"/>
                                </a>
                            </div>
                            <nav class="footer-nav">
                                <a href=".">Contact</a>
                                <a href=".">About</a>
                                <a href=".">IG FB TW</a>
                            </nav>
                        </div>
                    </footer>
                </section>

            </React.Fragment>
        );
    }
}

export default App;
